import "./card.scss";

const Card = ({ album }) => {
  console.log("album", album?.data?.converArt);
  return (
    <div className="card">
      <div className="img-ctn">
        {album?.covertArt?.sources?.map((source, index) => (
          <img
            key={index}
            src={source.url}
            width={source.width}
            height={source.height}
          />
        ))}
      </div>
      <div className="txt-ctn">
        <h5 className="title">{album?.data?.name}</h5>
        <p className="desc">Lorem ipsum dolor sit amet.</p>
      </div>
    </div>
  );
};

export default Card;
